import React from "react";
import HeroComponent from "../Components/HomePage/HeroComponent";
import BodyComponent from "../Components/HomePage/BodyComponent";

function HomePage() {
  return (
    <React.Fragment>
        <HeroComponent /> 
        <BodyComponent />
    </React.Fragment>
  );
}

export default HomePage;
